    "2016-10-07T22:14:30.204242",nt"name": "nist-dual-resolution-images-from-paired-fingerprint-cards-nist-special-database-30",nt"isopen":
    true,nt"url": null,nt"notes": "NIST Special Database 30 is being distributed
    for use in development and testing fingerprint matching systems. This fingerprint
    database offers the user complete paired fingerprint cards that include all ten
    rolled fingerprints and the plain/flat impressions at the bottom of the card. Paired
    fingerprint cards are two sets of fingerprints for one individual captured at different
    dates. By including all the fingerprint data for the card pairs, a user can compare
    any combination of plain and rolled images. This database has 216 paired fingerprint
    cards. Each card is scanned at 39.4 pixels per mm (1000 ppi) and segmented into
    individual fingerprint images. The segmented images are in PNG format. Reference
    information is included in a metadata text file.This fingerprint data is available
    in two resolutions. Special Database 30 images are 1000 ppi and Special Database
    29 images are 500 ppi.",nt"license_title": "Other License Specified",nt"extras":
